import React from 'react';
import { HashRouter as Router, Route, Link } from "react-router-dom";
import ScrollAnim from 'rc-scroll-anim';
import content from './SectionsContent';
import iniciaScroll from './Scroll';
import Twn from './Twn';
import Transition from './Transition';
import CallDialog from './Dialog';
const ScrollOverPack = ScrollAnim.OverPack;

iniciaScroll();
const find = id => content.find(p => p.id === id);

const OverPack = ({data}) => {
    let n = find(data.params.id);

    return (

<ScrollOverPack
always={true}
appear={true}
playScale={0.5}
id={'dial'+n.id}
className='dial'
        style={{ position: 'fixed', height: '100vh',top: 0, zIndex: 1800 }}
>
<CallDialog
d={{
    p: {
        a: n.id
    }
}}/>
</ScrollOverPack>
    )
}
class Dials extends React.Component {
    componentDidMount() {
    }
    render() {

        return (content.map((i) => (
                <OverPack
                    data={{
                    params: {
                        id: i.id
                    }
                }}/>
        )));
    }
}
export default Dials;
